{
  "translationLines": [
    {
      "lineNumber": 116881,
      "originalJapaneseLine": "「あ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 116882,
      "originalJapaneseLine": "（ら、ランスさんが残念そうにしている……）",
      "translatedEnglishLine": "(Ra-Rance-san looks disappointed...)"
    },
    {
      "lineNumber": 116883,
      "originalJapaneseLine": "（……す、捨てられちゃう）",
      "translatedEnglishLine": "(...I-I'm going to be abandoned)"
    },
    {
      "lineNumber": 116884,
      "originalJapaneseLine": "「私は……その……」",
      "translatedEnglishLine": "\"I... um...\""
    },
    {
      "lineNumber": 116885,
      "originalJapaneseLine": "「し、しても、いいかなー……って……」",
      "translatedEnglishLine": "\"I-I was wondering if it might be okay to...\""
    },
    {
      "lineNumber": 116886,
      "originalJapaneseLine": "「ニミッツ！？」",
      "translatedEnglishLine": "\"Nimitz!?\""
    },
    {
      "lineNumber": 116887,
      "originalJapaneseLine": "「ら、ランスさん、が、したいなら……",
      "translatedEnglishLine": "\"I-if Rance-san wants to...\""
    },
    {
      "lineNumber": 116888,
      "originalJapaneseLine": "　わたし……頑張って、み、ます……",
      "translatedEnglishLine": "I... will try my best...\""
    },
    {
      "lineNumber": 116889,
      "originalJapaneseLine": "　あ、いえ、頑張らせて……くださ、い……！」",
      "translatedEnglishLine": "\"N-no, please let me do my best...!\""
    },
    {
      "lineNumber": 116890,
      "originalJapaneseLine": "「おーっ、そうかそうか、",
      "translatedEnglishLine": "\"Ohhh, I see, I see,"
    },
    {
      "lineNumber": 116891,
      "originalJapaneseLine": "　ニミッツは良い子だなー」",
      "translatedEnglishLine": "Nimitz is such a good girl.\""
    },
    {
      "lineNumber": 116892,
      "originalJapaneseLine": "「あ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 116893,
      "originalJapaneseLine": "「えへへ……」",
      "translatedEnglishLine": "\"Ehehe...\""
    },
    {
      "lineNumber": 116894,
      "originalJapaneseLine": "（ああ、もう……",
      "translatedEnglishLine": "(Ah, geez..."
    },
    {
      "lineNumber": 116895,
      "originalJapaneseLine": "　まさか、こんなことになるなんて……）",
      "translatedEnglishLine": "I never thought it would come to this...)"
    },
    {
      "lineNumber": 116896,
      "originalJapaneseLine": "ランスに喜ばれて、",
      "translatedEnglishLine": "Seeing Nimitz happy because of Rance,"
    },
    {
      "lineNumber": 116897,
      "originalJapaneseLine": "心からに嬉しそうに笑っているニミッツを見て、",
      "translatedEnglishLine": "smiling genuinely with joy,"
    },
    {
      "lineNumber": 116898,
      "originalJapaneseLine": "メルフェイスはとっても悲しそうだった。",
      "translatedEnglishLine": "Meruface looked very sad."
    },
    {
      "lineNumber": 116899,
      "originalJapaneseLine": "「さーて、どうするんだ、メルフェイスちゃん。",
      "translatedEnglishLine": "\"Well then, what will you do, Meruface-chan?"
    },
    {
      "lineNumber": 116900,
      "originalJapaneseLine": "　可愛い教え子は頑張ると言っているようだが」",
      "translatedEnglishLine": "Your cute student seems to be saying she'll do her best.\""
    },
    {
      "lineNumber": 116901,
      "originalJapaneseLine": "「あ……その……」",
      "translatedEnglishLine": "\"Ah... um...\""
    },
    {
      "lineNumber": 116902,
      "originalJapaneseLine": "「ああ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 116903,
      "originalJapaneseLine": "結局、メルフェイスも押し切られ、",
      "translatedEnglishLine": "In the end, Meruface was also persuaded,"
    },
    {
      "lineNumber": 116904,
      "originalJapaneseLine": "三人で楽しんだ。",
      "translatedEnglishLine": "and the three of them enjoyed themselves."
    },
    {
      "lineNumber": 116905,
      "originalJapaneseLine": "「ばりぶりに暴れるわよ〜♪」",
      "translatedEnglishLine": "\"I'm going to go wild~♪\""
    },
    {
      "lineNumber": 116906,
      "originalJapaneseLine": "「この馬鹿もーん！」",
      "translatedEnglishLine": "\"You stupid idiot!\""
    },
    {
      "lineNumber": 116907,
      "originalJapaneseLine": "「ひんっ！",
      "translatedEnglishLine": "\"Hiiin!"
    },
    {
      "lineNumber": 116908,
      "originalJapaneseLine": "　いたた、すみません、ランス様ぁ」",
      "translatedEnglishLine": "Ouch, sorry, Lord Rance.\""
    },
    {
      "lineNumber": 116909,
      "originalJapaneseLine": "「あら、賑やかだけどどうしたの？」",
      "translatedEnglishLine": "\"Oh my, it's lively, but what happened?\""
    },
    {
      "lineNumber": 116910,
      "originalJapaneseLine": "「この奴隷がまたポカしていたから、",
      "translatedEnglishLine": "\"This slave messed up again,"
    },
    {
      "lineNumber": 116911,
      "originalJapaneseLine": "　お仕置きしようとしていたところだ」",
      "translatedEnglishLine": "so I was about to punish her.\""
    },
    {
      "lineNumber": 116912,
      "originalJapaneseLine": "「さぁーて、何をしてやろうか……ぐふふ……」",
      "translatedEnglishLine": "\"Well then, what shall I do to you... guhuhu...\""
    },
    {
      "lineNumber": 116913,
      "originalJapaneseLine": "「ひいっ、目が怖い……",
      "translatedEnglishLine": "\"Eek, those eyes are scary..."
    },
    {
      "lineNumber": 116914,
      "originalJapaneseLine": "　目が怖いです、ランス様……」",
      "translatedEnglishLine": "Those eyes are scary, Lord Rance...\""
    },
    {
      "lineNumber": 116915,
      "originalJapaneseLine": "「しかし、今まで色んなお仕置きやってきたから、",
      "translatedEnglishLine": "\"But, since I've done various punishments until now,"
    },
    {
      "lineNumber": 116916,
      "originalJapaneseLine": "　いい加減ネタ切れだな……さて……」",
      "translatedEnglishLine": "I'm running out of ideas... now then...\""
    },
    {
      "lineNumber": 116917,
      "originalJapaneseLine": "「私がやってあげようか？」",
      "translatedEnglishLine": "\"Shall I do it for you?\""
    },
    {
      "lineNumber": 116918,
      "originalJapaneseLine": "「お嬢ちゃん、可愛いし……",
      "translatedEnglishLine": "\"You're cute, little lady..."
    },
    {
      "lineNumber": 116919,
      "originalJapaneseLine": "　んふ、きっと楽しいわよぉ〜」",
      "translatedEnglishLine": "Nfu, it'll definitely be fun~\""
    },
    {
      "lineNumber": 116920,
      "originalJapaneseLine": "「ひっ……！」",
      "translatedEnglishLine": "\"Eek...!\""
    },
    {
      "lineNumber": 116921,
      "originalJapaneseLine": "「……具体的に何する気だ？」",
      "translatedEnglishLine": "\"...What exactly do you plan to do?\""
    },
    {
      "lineNumber": 116922,
      "originalJapaneseLine": "「鏡の中に閉じ込めてー、",
      "translatedEnglishLine": "\"Trap her inside a mirror—"
    },
    {
      "lineNumber": 116923,
      "originalJapaneseLine": "バラバラにしてー、",
      "translatedEnglishLine": "Break her into pieces—"
    },
    {
      "lineNumber": 116924,
      "originalJapaneseLine": "　世界中の迷宮の中に散らばらせる？」",
      "translatedEnglishLine": "And scatter them throughout labyrinths all around the world?\""
    },
    {
      "lineNumber": 116925,
      "originalJapaneseLine": "「やめんか、アホ！」",
      "translatedEnglishLine": "\"Stop that, idiot!\""
    },
    {
      "lineNumber": 116926,
      "originalJapaneseLine": "「えー、でも、女の子はみんな、",
      "translatedEnglishLine": "\"Ehh, but all the girls"
    },
    {
      "lineNumber": 116927,
      "originalJapaneseLine": "　可愛く怯えてくれるのよー？」",
      "translatedEnglishLine": "get so adorably scared, you know?\""
    },
    {
      "lineNumber": 116928,
      "originalJapaneseLine": "「鏡の魔女さんです……怖いです……」",
      "translatedEnglishLine": "\"She's the Mirror Witch... it's scary...\""
    },
    {
      "lineNumber": 116929,
      "originalJapaneseLine": "「なんだかんだ言ってもやっぱ悪い奴だな」",
      "translatedEnglishLine": "\"No matter what, you're still a bad person.\""
    },
    {
      "lineNumber": 116930,
      "originalJapaneseLine": "「お前は向こうでカレーうどんでも食ってろ。」",
      "translatedEnglishLine": "\"You just go over there and eat some curry udon.\""
    }
  ]
}

